import React from 'react';
import styles from '../Header.module.css';

const NavItem = ({ ShowLink, children }) => {
  const onClick = (event) => {
    event.preventDefault();
  };

  return (
    <li className={ShowLink ? styles.ShowLink : styles.navItem}>
      <NavLink href="#" onClick={onClick}>
        {children}
      </NavLink>
    </li>
  );
};

const NavLink = ({ href, children, onClick }) => {
  return (
    <a href={href} className={styles.navLink} onClick={onClick}>
      {children}
    </a>
  );
};

export { NavItem, NavLink };
